webpackJsonp([0xed4db155b68b],{477:function(t,e){t.exports={data:{markdownRemark:{html:'<h3 id="comparison"><a href="#comparison" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Comparison</h3>\n<p>Here, we share how <code>ReactiveSearch</code> compares with other projects that have similar aims.</p>\n<br />\n<table>\n<thead>\n<tr>\n<th align="right"><strong>#</strong></th>\n<th align="center"><strong>ReactiveSearch</strong></th>\n<th align="center"><strong>SearchKit</strong></th>\n<th align="center"><strong>InstantSearch</strong></th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td align="right"><strong>Backend</strong></td>\n<td align="center">Any Elasticsearch index hosted on any Elasticsearch cluster.</td>\n<td align="center">Any Elasticsearch index hosted on any Elasticsearch cluster.</td>\n<td align="center">Custom-built for Algolia, a proprietary search engine.</td>\n</tr>\n<tr>\n<td align="right"><strong>Development</strong></td>\n<td align="center">Actively developed and maintained.</td>\n<td align="center">Active issue responses, some development and maintenance.</td>\n<td align="center">Actively developed and maintained.</td>\n</tr>\n<tr>\n<td align="right"><strong>Onboarding Experience</strong></td>\n<td align="center">Starter apps, Live interactive tutorial, getting started guide, component playground, every component has a live working demo with codesandbox.</td>\n<td align="center">Getting started tutorial, no live component demos, sparse reference spec for many components.</td>\n<td align="center">Starter apps, getting started guide, component playground.</td>\n</tr>\n<tr>\n<td align="right"><strong>Styling Support</strong></td>\n<td align="center">Styled and scoped components. No external CSS import required. Rich theming supported as React props.</td>\n<td align="center">CSS based styles with BEM, not scoped to components. Theming supported with SCSS.</td>\n<td align="center">CSS based styles, requires external style import. Theming supported by manipulating CSS.</td>\n</tr>\n<tr>\n<td align="right"><strong>Types of Components</strong></td>\n<td align="center">Lists, Ranges, Search, Dates, Maps*, Result Displays. Can use your own UI components. (Maps need an upgrade)</td>\n<td align="center">Lists, Ranges, Search\n<em>, Result</em>\n. Canâ€™t use your own UI components. (Only one component for Search and Result, resulting in more code to be written for customizability)</td>\n<td align="center">Lists, Range, Search, Result. Can use your own UI components.</td>\n</tr>\n<tr>\n<td align="right"><strong>Supported Distribution Platforms</strong></td>\n<td align="center">React, React Native for mobile in alpha and actively developed.</td>\n<td align="center">React for Web.</td>\n<td align="center">React, Vue, Angular, vanilla JS for Web, React Native for mobile but latter has no UI components.</td>\n</tr>\n</tbody>\n</table>\n<p>We welcome contributions on this page, and would like to add that our ideas on how other projects compare is based on a cursory comparison. We often get asked about this.</p>\n<p>If you are building a project or you know of another project that is in the similar space, let us know and we will update the comparisons.</p>',frontmatter:{title:"Comparison with Other Projects",next:null,prev:"advanced/guides.html",nextTitle:null,prevTitle:"Advanced Guides"},fields:{path:"docs/advanced/Comparison.md",slug:"advanced/comparison.html"}}},pathContext:{slug:"advanced/comparison.html"}}}});
